import React from "react";
import { ReactComponent as AddIcon } from "./add.svg";

const AddButton = ({ OnClick }) => {
  <button
    class="ui icon button"
    style={{
      position: "absolute",
      left: "50%",
      top: "70%",
      transform: "translate(-50%, -50%) scale(0.07)"
    }}
  >
    <AddIcon />
  </button>;
};

export default AddButton;
